-- Table: country

DROP TABLE country;

CREATE TABLE country
(
  create_user_id text NOT NULL,
  create_timestamp timestamp without time zone NOT NULL,
  update_user_id text,
  update_timestamp timestamp without time zone,
  country_name text NOT NULL,
  continent text NOT NULL,
  iso_alpha_2_code text NOT NULL,
  iso_alpha_3_code text NOT NULL,
  iso_numeric_code text NOT NULL,
  calling_code bigint,
  currency_code text,
  population bigint,
  CONSTRAINT pk_country PRIMARY KEY (country_name),
  CONSTRAINT uk1_country UNIQUE (iso_alpha_2_code),
  CONSTRAINT uk2_country UNIQUE (iso_alpha_3_code),
  CONSTRAINT uk3_country UNIQUE (iso_numeric_code)
)
WITH (
  OIDS=false
);
ALTER TABLE country
  OWNER TO easyapp;
GRANT ALL ON TABLE country TO public;
GRANT ALL ON TABLE country TO easyapp;

-- Table: city

DROP TABLE city;

CREATE TABLE city
(
  create_user_id text NOT NULL,
  create_timestamp timestamp without time zone NOT NULL,
  update_user_id text,
  update_timestamp timestamp without time zone,
  city_name text NOT NULL,
  state_or_province text NOT NULL,
  country_name text NOT NULL,
  is_capital boolean,
  calling_code bigint,
  timezone text,
  latitude numeric,
  longitude numeric,
  population bigint,
  CONSTRAINT pk_city PRIMARY KEY (city_name, state_or_province, country_name)
)
WITH (
  OIDS=false
);
ALTER TABLE city
  OWNER TO easyapp;
GRANT ALL ON TABLE city TO public;
GRANT ALL ON TABLE city TO easyapp;



